import Vue from 'vue'
import App from './App.vue'
import router from "./router";
import createStore from 'vuex';


// Cria uma nova instância do store.
const store = createStore({
  state () {
    return {
      count: 1
    }
  }
})

app.use(store);


Vue.config.productionTip = false

new Vue({
  router,
  render: h => h(App),
}).$mount('#app')
